{ "text": null, "code": "using UnityEngine;

public class BananaChase : MonoBehaviour
{
    private Transform player;
    private float speed = 2.0f;

    void Start()
    {
        player = GameObject.Find("Player").transform;
    }

    void Update()
    {
        Transform banana = GameObject.Find("Banana").transform;
        Vector3 direction = (player.position - banana.position).normalized;
        banana.position += direction * speed * Time.deltaTime;
    }
}", "objectName": "Banana" }

{ "text": null, "code": "using UnityEngine;

public class DiscoBallBehavior : MonoBehaviour
{
    private Renderer melonRenderer;
    private Color[] colors = { Color.red, Color.green, Color.blue, Color.yellow, Color.magenta, Color.cyan };
    private float changeInterval = 0.5f;
    private float timer = 0f;

    void Start()
    {
        melonRenderer = GetComponent<Renderer>();
    }

    void Update()
    {
        timer += Time.deltaTime;
        if (timer >= changeInterval)
        {
            ChangeColor();
            timer = 0f;
        }
    }

    void ChangeColor()
    {
        int randomIndex = Random.Range(0, colors.Length);
        melonRenderer.material.color = colors[randomIndex];
    }
}", "objectName": "Melon" }
